    "title": "Frequently Asked Questions",
    "items": [
      {
        "itemIndex": 0,
        "question": "On which platforms is Terra Nova available?",
        "answer": "Terra Nova is available on Windows and Mac. A mobile companion app is planned for the next release."
      },
      {
        "itemIndex": 1,
        "question": "Is multiplayer gameplay available?",
        "answer": "Yes, multiplayer mode allows you to form alliances, trade, and engage in real-time battles with other players."
      },
      {
        "itemIndex": 2,
        "question": "How can I join an alliance?",
        "answer": "Navigate to the 'Alliance' menu in-game, browse the available alliances, and request to join. Alliance leaders can accept or decline requests."
      },
      {
        "itemIndex": 3,
        "question": "Are there in-game purchases?",
        "answer": "Yes, optional cosmetic items and expansion packs are available, but the core gameplay is free."
      },
      {
        "itemIndex": 4,
        "question": "Is there a tutorial for new players?",
        "answer": "Absolutely! The first mission acts as a tutorial, and in-game tips assist new players in getting started."
      }
    ]
  }
]
